description:
&nbsp;...candidato/a ideale si presenta con i seguenti requisiti:
laurea in ambito STEM o cultura equivalente (Scienza, Tecnologia, Ingegneria, <b>Matematica)</b>;
Esperienza pregressa di almeno 3 anni in una realtà di System Integrator;
Conoscenza su infrastrutture Cloud;
Conoscenza in...&nbsp;

&nbsp;...un progetto IT.
Il candidato ideale possiede le seguenti caratteristiche, competenze e formazione:
Laurea in ambito scientifico (<b>Matematica,</b> Informatica, Fisica, Ingegneria) o Diploma Informatico;
Esperienza pregressa di almeno 3 anni nel ruolo;
Buona conoscenza della...&nbsp;

&nbsp;...titolo preferenziale i seguenti requisiti:
Laurea in STEM (Informatica, Elettronica, Telecomunicazioni, Statistica, Ingegneria, <b>Matematica,</b> Fisica o simili).
Certificazioni in ambito Gestione Progetti quali a titolo esemplificativo: DevOps Foundation - DevSecOps Foundation...&nbsp;

&nbsp;...tanto para el rendimiento como para la capacidad de fabricación. 
  Enumeración de tareas a realizar:  

 Liderar el diseño y <b>modelado </b>3D de todos los componentes mecánicos de un túnel de congelación de nitrógeno o mecánico utilizando Autodesk Fusion 360....&nbsp;

&nbsp;...mas no es excluyente.
+ Al menos 2 año de experiencia en el desarrollo digital de proyectos utilizando metodología BIM, incluyendo <b>modelado </b>3D, trabajo colaborativo en la nube, resolución de conflictos y documentación 2D.
+ Conocimiento de código AASHTO LRFD Bridge...&nbsp;
